import base64
from io import BytesIO
from tkinter import PhotoImage
import os


WESTERN_LOGO  = """"""

SETTINGS_ICON = """"""

def getWesternLogo():
    return getPhotoImage(WESTERN_LOGO)

def getSettingsIcon():
    return getPhotoImage(SETTINGS_ICON)

def getPhotoImage(encoded_image=WESTERN_LOGO):
    try:
        img_data = base64.b64decode(encoded_image)
        img_stream = BytesIO(img_data)
        img = PhotoImage(data=img_stream.read())
        return img
    except Exception as e:
        print(f"Error decoding base64 logo: {e}")
        return None
    
def createLogoImage(encoded_logo=WESTERN_LOGO):
    try:
        logo_data = base64.b64decode(encoded_logo)
        # Create a temporary file to store the logo
        temp_logo_path = os.path.join(os.environ.get("TEMP"), "temp_logo.png")
        with open(temp_logo_path, "wb") as f:
            f.write(logo_data)
    except Exception as e:
        print(f"Error loading embedded logo: {e}")
    print("Logo image created at:", temp_logo_path)
    return temp_logo_path

import base64

def encode_image(image_name, print_output=False):
    try:
        os.chdir(os.path.dirname(__file__))
        with open(image_name, "rb") as image_file:
            encoded_string = base64.b64encode(image_file.read()).decode("utf-8")
            if print_output:
                print(encoded_string)
            return encoded_string
    except FileNotFoundError:
        print(f"File '{image_name}' not found.")
    except Exception as e:
        print(f"Error encoding image: {e}")